define('aeonvera/router', ['exports', 'ember', 'aeonvera/config/environment'], function (exports, Ember, config) {

  'use strict';

  var Router = Ember['default'].Router.extend({
    location: config['default'].locationType
  });
  /*
    Notes:

    route == verb
    resource == noun

    this.resource('post', function(){
      this.route('comment'); // PostCommentRoute
      this.resource('comment'); // CommentRoute
    });

    index route is automatic
  */
  exports['default'] = Router.map(function () {

    this.route('logout');
    this.route('login');
    this.route('signup');
    this.route('password-reset', function () {
      this.route('success');
    });

    /* event registration - subdomain based */
    this.route('dance-event', function () {
      this.route('register', function () {
        this.route('review');
        this.route('thankyou');
        this.route('new');
        this.route('edit');
      });
    });

    /* organization registration - subdomain based */
    this.route('dance-community', function () {
      this.route('unauthenticated', function () {});

      this.route('register', function () {
        this.route('review');
        this.route('thankyou');
        this.route('new');
        this.route('edit');
      });

      this.route('registration-history', function () {
        this.route('show', {
          path: ':order_id'
        });
      });
    });

    /* public facing */
    this.route('welcome', {
      resetNamespace: true
    }, function () {
      this.route('features');
      this.route('pricing');
      this.route('faq');
      this.route('tos', function () {
        this.route('organizers');
        this.route('non-organizers');
        this.route('updates');
      });
      this.route('opensource');
      this.route('privacy');
      this.route('about');
    });

    /* must be logged in for */
    this.route('dashboard', {
      path: '/'
    }, function () {
      this.route('hosted-events');
      this.route('registered-events');
      this.route('orders');

      this.route('event-at-the-door', {
        resetNamespace: true,
        path: '/event-at-the-door/:event_id'
      }, function () {
        this.route('checkin');
        this.route('competition-list');
        this.route('a-la-carte');
      });
      this.route('events', {
        resetNamespace: true
      }, function () {
        this.route('show', {
          path: ':event_id'
        }, function () {
          this.route('edit', function () {
            this.route('housing');
            this.route('options');
            this.route('customization');
            this.route('payment-processors');
          });

          /* attendees, volunteers, etc */
          this.route('registrations', function () {
            this.route('new');
            this.route('show', {
              path: ':registration_id'
            }, function () {
              this.route('edit');
            });
          });
          this.route('unpaid-registrations');
          this.route('cancelled-registrations');
          this.route('revenue');
          this.route('charts');
          this.route('manage');
          this.route('volunteers', function () {
            this.route('new');
          });

          this.route('checkin', function () {
            this.route('take-payment');
          });

          this.route('housing', function () {
            this.route('requests', function () {
              this.route('new');
            });
            this.route('provisions', function () {
              this.route('new');
            });
          });

          /* manage routes */
          this.route('levels', function () {
            this.route('new');
            this.route('show', {
              path: ':level_id'
            }, function () {
              this.route('edit');
            });
          });
          this.route('packages', function () {
            this.route('new');
            this.route('show', {
              path: ':package_id'
            }, function () {
              this.route('edit');
            });
          });
          this.route('a-la-carte-items', function () {
            this.route('new');
            this.route('show', {
              path: ':line_item_id'
            }, function () {
              this.route('edit');
            });
          });
          this.route('shirts', function () {
            this.route('new');
            this.route('show', {
              path: ':shirt_id'
            }, function () {
              this.route('edit');
            });
          });
          this.route('raffles', function () {
            this.route('new');
            this.route('show', {
              path: ':raffle_id'
            }, function () {
              this.route('edit');
            });
          });
          this.route('custom-fields', function () {
            this.route('new');
            this.route('show', {
              path: ':custom_field_id'
            }, function () {
              this.route('edit');
            });
          });
          this.route('discounts', function () {
            this.route('new');
            this.route('show', {
              path: ':discount_id'
            }, function () {
              this.route('edit');
            });
          });
          this.route('pricing-tiers', function () {
            this.route('new');
            this.route('show', {
              path: ':pricing_tier_id'
            }, function () {
              this.route('edit');
            });
          });
        });
      });
    });

    this.route('register', {
      path: 'r'
    }, function () {
      this.route('level');
      this.route('packages');
    });

    this.route("upcoming-events");
    this.route('communities');

    this.route('user', {
      resetNamespace: true
    }, function () {
      this.route('edit');
    });

    /*
      404ish
    */
    this.route('not-found', {
      path: '/*path'
    });
  });

});
define('aeonvera/routes/application', ['exports', 'ember', 'ember-simple-auth/mixins/application-route-mixin'], function (exports, Ember, ApplicationRouteMixin) {

  'use strict';

  exports['default'] = Ember['default'].Route.extend(ApplicationRouteMixin['default'], {
    session: Ember['default'].inject.service('session'),
    subdomain: Ember['default'].inject.service('subdomain'),

    // intl: Ember.inject.service(),
    beforeModel: function beforeModel(transition) {
      var _this = this;

      //   // define the app's runtime locale
      //   // For example, here you would maybe do an API lookup to resolver
      //   // which locale the user should be targeted and perhaps lazily
      //   // load translations using XHR and calling intl's `addTranslation`/`addTranslations`
      //   // method with the results of the XHR request
      //   this.get('intl').setLocale('en-us');
      var subdomainRoute = this.get('subdomain.route');

      if (subdomainRoute !== undefined) {
        this.get('subdomain.route').then(function (success) {
          _this.transitionTo(success);
        }, function (failure) {
          _this._super(transition);
        });
      }
    },

    // http://stackoverflow.com/questions/12150624/ember-js-multiple-named-outlet-usage
    renderTemplate: function renderTemplate() {

      // Render default outlet
      this.render();

      // render footer
      this.render('shared/footer', {
        outlet: 'bottom-footer',
        into: 'application'
      });
    },

    sessionAuthenticated: function sessionAuthenticated() {
      this._super();

      // close the modal
      Ember['default'].$('a.close-reveal-modal').trigger('click');

      // notify of success
      Ember['default'].get(this, 'flashMessages').success('You have successfully logged in');
    },

    actions: {

      linkToRoute: function linkToRoute(item) {
        this.transitionTo(item.route);
      },

      exitOffCanvas: function exitOffCanvas() {
        this.$('a.exit-off-canvas').click();
      },

      redirectToLogin: function redirectToLogin() {
        this.transitionTo('login');
      },

      redirectToSignup: function redirectToSignup() {
        this.transitionTo('signup');
      },

      invalidateSession: function invalidateSession() {
        this.get('session').invalidate();
        localStorage.clear();
      },

      transitionToLoginRoute: function transitionToLoginRoute() {
        //  this.transitionTo('login');
        this.transitionTo('welcome');
      }

    }
  });

});
